import Portada from '../assets/IMG (4).jpeg'
//import Cintura from '../assets/CINTURONES TACTICOS.jpg'
import './Imagen.css'
export class imagen extends Component {
  render() {
    return (
      <div className='slider'>
          <ui>
            <li><img src={Portada} alt="" /></li>
            <li><img src={Portada} alt="" /></li>
            <li><img src={Portada} alt="" /></li>
            <li><img src={Portada} alt="" /></li>
          </ui>
      </div>
    )
  }
}

export default imagen
